import React from "react";
import { Redirect } from "react-router-dom";

// Authentication related pages
import Login from "../pages/Authentication/Login";
import Logout from "../pages/Authentication/Logout";
import Register from "../pages/Authentication/Register";
import WriterSignup from "../pages/Writer/WriterSignup";
import ForgetPwd from "../pages/Authentication/ForgetPassword";

// Dashboard
import Dashboard from "../pages/Dashboard/index";

// Order
import Orders from "../pages/Orders/index";
import NewOrder from "../pages/Orders/NewOrder";
import OrderPage from "../pages/Orders/Orderpage"

// Profile
import Profile from "../pages/Profile/Profile";

// Support
import Support from "../pages/Support/Support";

//Payments
import Payments from "../pages/Payments/Payments";

//Order Succesful
import OrderCallback from "../pages/Orders/OrderCallback";



const userRoutes = [
  // Dashboard
  { path: "/dashboard", component: Dashboard },

  // Orders
  { path: "/orders", component: Orders },
  { path: "/orderpage/:id?", component: OrderPage },
  { path: "/new-order", component: NewOrder },

  // Profile
  { path: "/profile", component: Profile },

  // Support
  { path: "/support", component: Support },

  //Payments
  {path : "/payments" , component : Payments},

  //Order callback
  {path : "/ordercallback" , component : OrderCallback},


  // this route should be at the end of all other routes
  { path: "/", exact: true, component: () => <Redirect to="/dashboard" /> },
];





const authRoutes = [
  { path: "/logout", component: Logout },
  { path: "/login", component: Login },
  { path: "/forgot-password", component: ForgetPwd },
  { path: "/register", component: Register },
  { path: "/become-writer", component: WriterSignup}
];

export { userRoutes, authRoutes };
